    follow this report as the text is too long for validation with this report.  The
    receipts reported on Schedule A Line 15 from  Wyden for Senate, Future PAC,  Multnomah
    County Democratic Central Comm. and Senate Democratic Leadership Fund are offsets
    for the payment of rent. The Democratic Party of Oregon shares office space with
    several organizations. We write one check to pay rent. The amount of rent paid
    by each organization is assessed at the usual and normal charge, determinined
    by the amount of space occupied by the organization. Payments for salaries and
    wages reported on Schedule H4 are for employees who spent less than 25% of their
    time on FEA or activities in connection with a Federal election. Employees who
